import React from "react";

export function Sidebar(props) {
  return (<div className="sidebar">
    <div className="icon"> <img src={props.menuItems} alt="homeIcon" /> </div>
    <div className="icon"> <img src={props.fireIco} alt="fireIcon" /> </div>
    <div className="icon"> <img src={props.subscriptionIcon} alt="logo" /> </div>
    <div className="icon"> <img src={props.logo} alt="logo" /> </div>
  </div>)
}
